<p>由于钉钉没有现成的类似 <a href="https://youzan.github.io/vant-weapp/#/picker" title="vant-weapp" target="_blank" rel="noopener noreferrer">vant-weapp</a> 这样的 picker 选择组件，于是打算自己封装一个。使用到的依赖有<code>mini-ali-ui</code>的 popup 和 button 组件。使用了原生的<code>picker-view</code></p>
